int game_handle_input(int eventCode, bool isInCombatMode)
{
    // NOTE: Uninline.
    if (game_state() == GAME_STATE_5) {
        dialogue_system_enter();
    }

    if (eventCode == -1) {
        if ((mouse_get_buttons() & MOUSE_EVENT_WHEEL) != 0) {
            int wheelX;
            int wheelY;
            mouseGetWheel(&wheelX, &wheelY);

            int dx = 0;
            if (wheelX > 0) {
                dx = 1;
            } else if (wheelX < 0) {
                dx = -1;
            }

            int dy = 0;
            if (wheelY > 0) {
                dy = -1;
            } else if (wheelY < 0) {
                dy = 1;
            }

            map_scroll(dx, dy);
        }
        return 0;
    }

    if (eventCode == -2) {
        int mouseState = mouse_get_buttons();
        int mouseX;
        int mouseY;
        mouse_get_position(&mouseX, &mouseY);

        if ((mouseState & MOUSE_EVENT_LEFT_BUTTON_DOWN) != 0) {
            if ((mouseState & MOUSE_EVENT_LEFT_BUTTON_REPEAT) == 0) {
                if (mouseX == scr_size.ulx || mouseX == scr_size.lrx
                    || mouseY == scr_size.uly || mouseY == scr_size.lry) {
                    gmouse_clicked_on_edge = true;
                } else {
                    gmouse_clicked_on_edge = false;
                }
            }
        } else {
            if ((mouseState & MOUSE_EVENT_LEFT_BUTTON_UP) != 0) {
                gmouse_clicked_on_edge = false;
            }
        }

        gmouse_handle_event(mouseX, mouseY, mouseState);
        return 0;
    }

    if (gmouse_is_scrolling()) {
        return 0;
    }

    switch (eventCode) {
    case -20:
        if (intface_is_enabled()) {
            intface_use_item();
        }
        break;
    case -2:
        if (1) {
            int mouseEvent = mouse_get_buttons();
            int mouseX;
            int mouseY;
            mouse_get_position(&mouseX, &mouseY);

            if ((mouseEvent & MOUSE_EVENT_LEFT_BUTTON_DOWN) != 0) {
                if ((mouseEvent & MOUSE_EVENT_LEFT_BUTTON_REPEAT) == 0) {
                    if (mouseX == scr_size.ulx || mouseX == scr_size.lrx
                        || mouseY == scr_size.uly || mouseY == scr_size.lry) {
                        gmouse_clicked_on_edge = true;
                    } else {
                        gmouse_clicked_on_edge = false;
                    }
                }
            } else {
                if ((mouseEvent & MOUSE_EVENT_LEFT_BUTTON_UP) != 0) {
                    gmouse_clicked_on_edge = false;
                }
            }

            gmouse_handle_event(mouseX, mouseY, mouseEvent);
        }
        break;
    case KEY_CTRL_Q:
    case KEY_CTRL_X:
    case KEY_F10:
        gsound_play_sfx_file("ib1p1xx1");
        game_quit_with_confirm();
        break;
    case KEY_TAB:
        if (intface_is_enabled()
            && keys[SDL_SCANCODE_LALT] == 0
            && keys[SDL_SCANCODE_RALT] == 0) {
            gsound_play_sfx_file("ib1p1xx1");
            automap(true, false);
        }
        break;
    case KEY_CTRL_P:
        gsound_play_sfx_file("ib1p1xx1");
        PauseWindow(false);
        break;
    case KEY_UPPERCASE_A:
    case KEY_LOWERCASE_A:
        if (intface_is_enabled()) {
            if (!isInCombatMode) {
                combat(NULL);
            }
        }
        break;
    case KEY_UPPERCASE_N:
    case KEY_LOWERCASE_N:
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");
            intface_toggle_item_state();
        }
        break;
    case KEY_UPPERCASE_M:
    case KEY_LOWERCASE_M:
        gmouse_3d_toggle_mode();
        break;
    case KEY_UPPERCASE_B:
    case KEY_LOWERCASE_B:
        // change active hand
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");
            intface_toggle_items(true);
        }
        break;
    case KEY_UPPERCASE_C:
    case KEY_LOWERCASE_C:
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");
            bool isoWasEnabled = map_disable_bk_processes();
            editor_design(false);
            if (isoWasEnabled) {
                map_enable_bk_processes();
            }
        }
        break;
    case KEY_UPPERCASE_I:
    case KEY_LOWERCASE_I:
        // open inventory
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");
            handle_inventory();
        }
        break;
    case KEY_ESCAPE:
    case KEY_UPPERCASE_O:
    case KEY_LOWERCASE_O:
        // options
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");
            do_options();
        }
        break;
    case KEY_UPPERCASE_P:
    case KEY_LOWERCASE_P:
        // pipboy
        if (intface_is_enabled()) {
            if (isInCombatMode) {
                gsound_play_sfx_file("iisxxxx1");

                // Pipboy not available in combat!
                MessageListItem messageListItem;
                char title[128];
                strcpy(title, getmsg(&misc_message_file, &messageListItem, 7));
                dialog_out(title, NULL, 0, 192, 116, colorTable[32328], NULL, colorTable[32328], 0);
            } else {
                gsound_play_sfx_file("ib1p1xx1");
                pipboy(false);
            }
        }
        break;
    case KEY_UPPERCASE_S:
    case KEY_LOWERCASE_S:
        // skilldex
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");

            int mode = -1;

            // NOTE: There is an `inc` for this value to build jump table which
            // is not needed.
            int rc = skilldex_select();

            // Remap Skilldex result code to action.
            switch (rc) {
            case SKILLDEX_RC_ERROR:
                debug_printf("\n ** Error calling skilldex_select()! ** \n");
                break;
            case SKILLDEX_RC_SNEAK:
                action_skill_use(SKILL_SNEAK);
                break;
            case SKILLDEX_RC_LOCKPICK:
                mode = GAME_MOUSE_MODE_USE_LOCKPICK;
                break;
            case SKILLDEX_RC_STEAL:
                mode = GAME_MOUSE_MODE_USE_STEAL;
                break;
            case SKILLDEX_RC_TRAPS:
                mode = GAME_MOUSE_MODE_USE_TRAPS;
                break;
            case SKILLDEX_RC_FIRST_AID:
                mode = GAME_MOUSE_MODE_USE_FIRST_AID;
                break;
            case SKILLDEX_RC_DOCTOR:
                mode = GAME_MOUSE_MODE_USE_DOCTOR;
                break;
            case SKILLDEX_RC_SCIENCE:
                mode = GAME_MOUSE_MODE_USE_SCIENCE;
                break;
            case SKILLDEX_RC_REPAIR:
                mode = GAME_MOUSE_MODE_USE_REPAIR;
                break;
            default:
                break;
            }

            if (mode != -1) {
                gmouse_set_cursor(MOUSE_CURSOR_USE_CROSSHAIR);
                gmouse_3d_set_mode(mode);
            }
        }
        break;
    case KEY_UPPERCASE_Z:
    case KEY_LOWERCASE_Z:
        if (intface_is_enabled()) {
            if (isInCombatMode) {
                gsound_play_sfx_file("iisxxxx1");

                // Pipboy not available in combat!
                MessageListItem messageListItem;
                char title[128];
                strcpy(title, getmsg(&misc_message_file, &messageListItem, 7));
                dialog_out(title, NULL, 0, 192, 116, colorTable[32328], NULL, colorTable[32328], 0);
            } else {
                gsound_play_sfx_file("ib1p1xx1");
                pipboy(true);
            }
        }
        break;
    case KEY_HOME:
        if (obj_dude->elevation != map_elevation) {
            map_set_elevation(obj_dude->elevation);
        }

        if (game_in_mapper) {
            tile_set_center(obj_dude->tile, TILE_SET_CENTER_REFRESH_WINDOW);
        } else {
            tile_scroll_to(obj_dude->tile, 2);
        }

        break;
    case KEY_1:
    case KEY_EXCLAMATION:
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");
            gmouse_set_cursor(MOUSE_CURSOR_USE_CROSSHAIR);
            action_skill_use(SKILL_SNEAK);
        }
        break;
    case KEY_2:
    case KEY_AT:
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");
            gmouse_set_cursor(MOUSE_CURSOR_USE_CROSSHAIR);
            gmouse_3d_set_mode(GAME_MOUSE_MODE_USE_LOCKPICK);
        }
        break;
    case KEY_3:
    case KEY_NUMBER_SIGN:
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");
            gmouse_set_cursor(MOUSE_CURSOR_USE_CROSSHAIR);
            gmouse_3d_set_mode(GAME_MOUSE_MODE_USE_STEAL);
        }
        break;
    case KEY_4:
    case KEY_DOLLAR:
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");
            gmouse_set_cursor(MOUSE_CURSOR_USE_CROSSHAIR);
            gmouse_3d_set_mode(GAME_MOUSE_MODE_USE_TRAPS);
        }
        break;
    case KEY_5:
    case KEY_PERCENT:
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");
            gmouse_set_cursor(MOUSE_CURSOR_USE_CROSSHAIR);
            gmouse_3d_set_mode(GAME_MOUSE_MODE_USE_FIRST_AID);
        }
        break;
    case KEY_6:
    case KEY_CARET:
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");
            gmouse_set_cursor(MOUSE_CURSOR_USE_CROSSHAIR);
            gmouse_3d_set_mode(GAME_MOUSE_MODE_USE_DOCTOR);
        }
        break;
    case KEY_7:
    case KEY_AMPERSAND:
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");
            gmouse_set_cursor(MOUSE_CURSOR_USE_CROSSHAIR);
            gmouse_3d_set_mode(GAME_MOUSE_MODE_USE_SCIENCE);
        }
        break;
    case KEY_8:
    case KEY_ASTERISK:
        if (intface_is_enabled()) {
            gsound_play_sfx_file("ib1p1xx1");
            gmouse_set_cursor(MOUSE_CURSOR_USE_CROSSHAIR);
            gmouse_3d_set_mode(GAME_MOUSE_MODE_USE_REPAIR);
        }
        break;
    case KEY_MINUS:
    case KEY_UNDERSCORE:
        DecGamma();
        break;
    case KEY_EQUAL:
    case KEY_PLUS:
        IncGamma();
        break;
    case KEY_COMMA:
    case KEY_LESS:
        if (register_begin(ANIMATION_REQUEST_RESERVED) == 0) {
            register_object_dec_rotation(obj_dude);
            register_end();
        }
        break;
    case KEY_DOT:
    case KEY_GREATER:
        if (register_begin(ANIMATION_REQUEST_RESERVED) == 0) {
            register_object_inc_rotation(obj_dude);
            register_end();
        }
        break;
    case KEY_SLASH:
    case KEY_QUESTION:
        if (1) {
            gsound_play_sfx_file("ib1p1xx1");

            int month;
            int day;
            int year;
            game_time_date(&month, &day, &year);

            MessageList messageList;
            if (message_init(&messageList)) {
                char path[COMPAT_MAX_PATH];
                snprintf(path, sizeof(path), "%s%s", msg_path, "editor.msg");

                if (message_load(&messageList, path)) {
                    MessageListItem messageListItem;
                    messageListItem.num = 500 + month - 1;
                    if (message_search(&messageList, &messageListItem)) {
                        char* time = game_time_hour_str();

                        char date[128];
                        snprintf(date, sizeof(date), "%s %d, %d %s", messageListItem.text, day, year, time);

                        display_print(date);
                    }
                }

                message_exit(&messageList);
            }
        }
        break;
    case KEY_F1:
        gsound_play_sfx_file("ib1p1xx1");
        game_help();
        break;
    case KEY_F2:
        gsound_set_master_volume(gsound_get_master_volume() - 2047);
        break;
    case KEY_F3:
        gsound_set_master_volume(gsound_get_master_volume() + 2047);
        break;
    case KEY_CTRL_S:
    case KEY_F4:
        gsound_play_sfx_file("ib1p1xx1");
        if (SaveGame(1) == -1) {
            debug_printf("\n ** Error calling SaveGame()! **\n");
        }
        break;
    case KEY_CTRL_L:
    case KEY_F5:
        gsound_play_sfx_file("ib1p1xx1");
        if (LoadGame(LOAD_SAVE_MODE_NORMAL) == -1) {
            debug_printf("\n ** Error calling LoadGame()! **\n");
        }
        break;
    case KEY_F6:
        if (1) {
            gsound_play_sfx_file("ib1p1xx1");

            int rc = SaveGame(LOAD_SAVE_MODE_QUICK);
            if (rc == -1) {
                debug_printf("\n ** Error calling SaveGame()! **\n");
            } else if (rc == 1) {
                MessageListItem messageListItem;
                // Quick save game successfully saved.
                char* msg = getmsg(&misc_message_file, &messageListItem, 5);
                display_print(msg);
            }
        }
        break;
    case KEY_F7:
        if (1) {
            gsound_play_sfx_file("ib1p1xx1");

            int rc = LoadGame(LOAD_SAVE_MODE_QUICK);
            if (rc == -1) {
                debug_printf("\n ** Error calling LoadGame()! **\n");
            } else if (rc == 1) {
                MessageListItem messageListItem;
                // Quick load game successfully loaded.
                char* msg = getmsg(&misc_message_file, &messageListItem, 4);
                display_print(msg);
            }
        }
        break;
    case KEY_CTRL_V:
        if (1) {
            gsound_play_sfx_file("ib1p1xx1");

            char version[VERSION_MAX];
            getverstr(version, sizeof(version));
            display_print(version);
            display_print(version_build_time);
        }
        break;
    case KEY_ARROW_LEFT:
        map_scroll(-1, 0);
        break;
    case KEY_ARROW_RIGHT:
        map_scroll(1, 0);
        break;
    case KEY_ARROW_UP:
        map_scroll(0, -1);
        break;
    case KEY_ARROW_DOWN:
        map_scroll(0, 1);
        break;
    }

    return 0;
}

void gmouse_handle_event(int mouseX, int mouseY, int mouseState)
{
    if (!gmouse_initialized) {
        return;
    }

    if (gmouse_current_cursor >= MOUSE_CURSOR_WAIT_PLANET) {
        return;
    }

    if (!gmouse_enabled) {
        return;
    }

    if (gmouse_clicked_on_edge) {
        if (gmouse_get_click_to_scroll()) {
            return;
        }
    }

    if (!mouse_click_in(0, 0, scr_size.lrx - scr_size.ulx, scr_size.lry - scr_size.uly - 100)) {
        return;
    }

    // CE: Make sure we cannot go outside of the map.
    if (!tile_point_inside_bound(mouseX, mouseY)) {
        return;
    }

    if ((mouseState & MOUSE_EVENT_RIGHT_BUTTON_DOWN) != 0) {
        if ((mouseState & MOUSE_EVENT_RIGHT_BUTTON_REPEAT) == 0) {
            if (gmouse_3d_is_on()) {
                gmouse_3d_toggle_mode();
            }
        }
        return;
    }

    if ((mouseState & MOUSE_EVENT_LEFT_BUTTON_UP) != 0) {
        if (gmouse_3d_current_mode == GAME_MOUSE_MODE_MOVE) {
            int actionPoints;
            if (isInCombat()) {
                actionPoints = combat_free_move + obj_dude->data.critter.combat.ap;
            } else {
                actionPoints = -1;
            }

            bool running;
            configGetBool(&game_config, GAME_CONFIG_PREFERENCES_KEY, GAME_CONFIG_RUNNING_KEY, &running);

            if (keys[SDL_SCANCODE_LSHIFT] || keys[SDL_SCANCODE_RSHIFT]) {
                if (running) {
                    dude_move(actionPoints);
                    return;
                }
            } else {
                if (!running) {
                    dude_move(actionPoints);
                    return;
                }
            }

            dude_run(actionPoints);
            return;
        }

        if (gmouse_3d_current_mode == GAME_MOUSE_MODE_ARROW) {
            Object* target = object_under_mouse(-1, true, map_elevation);
            if (target != NULL) {
                switch (FID_TYPE(target->fid)) {
                case OBJ_TYPE_ITEM:
                    action_get_an_object(obj_dude, target);
                    break;
                case OBJ_TYPE_CRITTER:
                    if (target == obj_dude) {
                        if (FID_ANIM_TYPE(obj_dude->fid) == ANIM_STAND) {
                            Rect a1;
                            if (obj_inc_rotation(target, &a1) == 0) {
                                tile_refresh_rect(&a1, target->elevation);
                            }
                        }
                    } else {
                        if (obj_action_can_talk_to(target)) {
                            if (isInCombat()) {
                                if (obj_examine(obj_dude, target) == -1) {
                                    obj_look_at(obj_dude, target);
                                }
                            } else {
                                action_talk_to(obj_dude, target);
                            }
                        } else {
                            action_loot_container(obj_dude, target);
                        }
                    }
                    break;
                case OBJ_TYPE_SCENERY:
                    if (proto_action_can_use(target->pid)) {
                        action_use_an_object(obj_dude, target);
                    } else {
                        if (obj_examine(obj_dude, target) == -1) {
                            obj_look_at(obj_dude, target);
                        }
                    }
                    break;
                case OBJ_TYPE_WALL:
                    if (obj_examine(obj_dude, target) == -1) {
                        obj_look_at(obj_dude, target);
                    }
                    break;
                }
            }
            return;
        }

        if (gmouse_3d_current_mode == GAME_MOUSE_MODE_CROSSHAIR) {
            Object* target = object_under_mouse(OBJ_TYPE_CRITTER, false, map_elevation);
            if (target != NULL) {
                combat_attack_this(target);
                gmouse_3d_hover_test = true;
                gmouse_3d_last_mouse_y = mouseY;
                gmouse_3d_last_mouse_x = mouseX;
                gmouse_3d_last_move_time = get_time() - 250;
            }
            return;
        }

        if (gmouse_3d_current_mode == GAME_MOUSE_MODE_USE_CROSSHAIR) {
            Object* target = object_under_mouse(-1, true, map_elevation);
            if (target != NULL) {
                Object* weapon;
                if (intface_get_current_item(&weapon) != -1) {
                    if (isInCombat()) {
                        int hitMode = intface_is_item_right_hand()
                            ? HIT_MODE_RIGHT_WEAPON_PRIMARY
                            : HIT_MODE_LEFT_WEAPON_PRIMARY;

                        int actionPointsRequired = item_mp_cost(obj_dude, hitMode, false);
                        if (actionPointsRequired <= obj_dude->data.critter.combat.ap) {
                            if (action_use_an_item_on_object(obj_dude, target, weapon) != -1) {
                                int actionPoints = obj_dude->data.critter.combat.ap;
                                if (actionPointsRequired > actionPoints) {
                                    obj_dude->data.critter.combat.ap = 0;
                                } else {
                                    obj_dude->data.critter.combat.ap -= actionPointsRequired;
                                }
                                intface_update_move_points(obj_dude->data.critter.combat.ap, combat_free_move);
                            }
                        }
                    } else {
                        action_use_an_item_on_object(obj_dude, target, weapon);
                    }
                }
            }
            gmouse_set_cursor(MOUSE_CURSOR_NONE);
            gmouse_3d_set_mode(GAME_MOUSE_MODE_MOVE);
            return;
        }

        if (gmouse_3d_current_mode == GAME_MOUSE_MODE_USE_FIRST_AID
            || gmouse_3d_current_mode == GAME_MOUSE_MODE_USE_DOCTOR
            || gmouse_3d_current_mode == GAME_MOUSE_MODE_USE_LOCKPICK
            || gmouse_3d_current_mode == GAME_MOUSE_MODE_USE_STEAL
            || gmouse_3d_current_mode == GAME_MOUSE_MODE_USE_TRAPS
            || gmouse_3d_current_mode == GAME_MOUSE_MODE_USE_SCIENCE
            || gmouse_3d_current_mode == GAME_MOUSE_MODE_USE_REPAIR) {
            Object* target = object_under_mouse(-1, 1, map_elevation);
            if (target == NULL || action_use_skill_on(obj_dude, target, gmouse_skill_table[gmouse_3d_current_mode - FIRST_GAME_MOUSE_MODE_SKILL]) != -1) {
                gmouse_set_cursor(MOUSE_CURSOR_NONE);
                gmouse_3d_set_mode(GAME_MOUSE_MODE_MOVE);
            }
            return;
        }
    }

    if ((mouseState & MOUSE_EVENT_LEFT_BUTTON_DOWN_REPEAT) == MOUSE_EVENT_LEFT_BUTTON_DOWN_REPEAT && gmouse_3d_current_mode == GAME_MOUSE_MODE_ARROW) {
        Object* target = object_under_mouse(-1, true, map_elevation);
        if (target != NULL) {
            int actionMenuItemsCount = 0;
            int actionMenuItems[6];
            switch (FID_TYPE(target->fid)) {
            case OBJ_TYPE_ITEM:
                actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_USE;
                actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_LOOK;
                if (item_get_type(target) == ITEM_TYPE_CONTAINER) {
                    actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_INVENTORY;
                    actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_USE_SKILL;
                }
                actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_CANCEL;
                break;
            case OBJ_TYPE_CRITTER:
                if (target == obj_dude) {
                    actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_ROTATE;
                } else {
                    if (obj_action_can_talk_to(target)) {
                        if (!isInCombat()) {
                            actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_TALK;
                        }
                    } else {
                        actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_USE;
                    }
                }

                actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_LOOK;
                actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_INVENTORY;
                actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_USE_SKILL;
                actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_CANCEL;
                break;
            case OBJ_TYPE_SCENERY:
                if (proto_action_can_use(target->pid)) {
                    actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_USE;
                }

                actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_LOOK;
                actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_INVENTORY;
                actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_USE_SKILL;
                actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_CANCEL;
                break;
            case OBJ_TYPE_WALL:
                actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_LOOK;
                if (proto_action_can_use(target->pid)) {
                    actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_INVENTORY;
                }
                actionMenuItems[actionMenuItemsCount++] = GAME_MOUSE_ACTION_MENU_ITEM_CANCEL;
                break;
            }

            if (gmouse_3d_build_menu_frame(mouseX, mouseY, actionMenuItems, actionMenuItemsCount, scr_size.lrx - scr_size.ulx + 1, scr_size.lry - scr_size.uly - 99) == 0) {
                Rect v43;
                int fid = art_id(OBJ_TYPE_INTERFACE, 283, 0, 0, 0);
                // NOTE: Uninline.
                if (gmouse_3d_set_flat_fid(fid, &v43) == 0 && gmouse_3d_move_to(mouseX, mouseY, map_elevation, &v43) == 0) {
                    tile_refresh_rect(&v43, map_elevation);
                    map_disable_bk_processes();

                    int v33 = mouseY;
                    int actionIndex = 0;
                    while ((mouse_get_buttons() & MOUSE_EVENT_LEFT_BUTTON_UP) == 0) {
                        sharedFpsLimiter.mark();

                        get_input();

                        if (game_user_wants_to_quit != 0) {
                            actionMenuItems[actionIndex] = 0;
                        }

                        int v48;
                        int v47;
                        mouse_get_position(&v48, &v47);

                        if (abs(v47 - v33) > 10) {
                            if (v33 >= v47) {
                                actionIndex -= 1;
                            } else {
                                actionIndex += 1;
                            }

                            if (gmouse_3d_highlight_menu_frame(actionIndex) == 0) {
                                tile_refresh_rect(&v43, map_elevation);
                            }
                            v33 = v47;
                        }

                        renderPresent();
                        sharedFpsLimiter.throttle();
                    }

                    map_enable_bk_processes();

                    gmouse_3d_hover_test = false;
                    gmouse_3d_last_mouse_x = mouseX;
                    gmouse_3d_last_mouse_y = mouseY;
                    gmouse_3d_last_move_time = get_time();

                    mouse_set_position(mouseX, v33);

                    if (gmouse_3d_reset_flat_fid(&v43) == 0) {
                        tile_refresh_rect(&v43, map_elevation);
                    }

                    switch (actionMenuItems[actionIndex]) {
                    case GAME_MOUSE_ACTION_MENU_ITEM_INVENTORY:
                        use_inventory_on(target);
                        break;
                    case GAME_MOUSE_ACTION_MENU_ITEM_LOOK:
                        if (obj_examine(obj_dude, target) == -1) {
                            obj_look_at(obj_dude, target);
